class NetSocket {
    constructor(maxConnections = 100) {
        this.maxConnections = maxConnections; // Maximum number of concurrent connections
        this.activeConnections = []; // Array to store active connections
    }

    HTTP(options, callback) {
        const parsedAddr = options.address.split(":");
        const addrHost = parsedAddr[0];
        const payload =
            "CONNECT " +
            options.address +
            ":443 HTTP/1.1\r\nHost: " +
            options.address +
            ":443\r\nConnection: Keep-Alive\r\n\r\n";
        const buffer = Buffer.from(payload); // Use Buffer.from instead of new Buffer

        // Create a new connection
        const connection = net.connect({
            host: options.host,
            port: options.port,
        });

        connection.setTimeout(options.timeout * 100000); // Adjust timeout as needed
        connection.setKeepAlive(true, 100000);

        connection.on("connect", () => {
            connection.write(buffer);
        });

        connection.on("data", (chunk) => {
            const response = chunk.toString("utf-8");
            const isAlive = response.includes("HTTP/1.1 200");
            if (!isAlive) {
                connection.destroy();
                return callback(undefined, "error: invalid response from proxy server");
            }
            this.activeConnections.push(connection); // Store the active connection
            return callback(connection, undefined);
        });

        connection.on("timeout", () => {
            connection.destroy();
            return callback(undefined, "error: timeout exceeded");
        });

        connection.on("error", (error) => {
            connection.destroy();
            return callback(undefined, "error: " + error);
        });

        // Remove connection from active connections on close
        connection.on("close", () => {
            this.activeConnections = this.activeConnections.filter((conn) => conn !== connection);
        });

        // Manage the number of active connections
        if (this.activeConnections.length >= this.maxConnections) {
            connection.destroy(); // Limit connections to maxConnections
            return callback(undefined, "error: max connections reached");
        }
    }
}

